Limited data from animal studies suggest that fluoxetine may undergo first-pass metabolism may occur via the liver and/or lungs. Fluoxetine appears to be extensively metabolized, likely in the liver, to norfluoxetine and other metabolites. Norfluoxetine, the principal active metabolite, is formed via <i>N</i>-demethylation of fluoxetine. Norfluoxetine appears to be comparable pharmacologic potency as fluoxetine. Fluoxetine and norfluoxetine both undergo phase II glucuronidation reactions in the liver. It is also thought that fluoxetine and norfluoxetine undergo <i>O</i>-dealkylation to form <i>p</i>-trifluoromethylphenol, which is then subsequently metabolized to hippuric acid. 
Route of Elimination: The primary route of elimination appears to be hepatic metabolism to inactive metabolites excreted by the kidney. The S-enantiomer is eliminated more slowly and is the predominant enantiomer present at steady state. 
Half Life: 1-3 days [acute administration];
4-6 days [chronic administration];
4-16 days [norfluoxetine, acute and chronic administration].
